    let [state ,setstate]=useState({
        user:{
            username:'',
            email:'',
            password:''
    
        }
    })
    let updateInput=(e)=>{
        setstate({
            ...state,
            user:{
                ...state.user,
                [e.target.name]:e.target.value
            }
        })
    }
    const SubmitFunc=(e)=>{
        e.preventDefault()
        setstate({...state},e.target.value)

    }
    return(
        <>
            <Navbar bg='success' expand='sm' variant='light'>
                <Container>
                <Navbar.Brand href='/'>
                   Home
                </Navbar.Brand>
                </Container> 
            </Navbar>
        </>

    )
}
